$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Als u bij het maken van een nieuw contactformulier klikt op [1]\"Voeg een nieuw invoerveld/rij toe om uw contactformulier te maken\"[/1] link en een invoerveld selecteert, wordt dit invoerveld standaard op een vol- breedte rij (1 kolom)';
