$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Lees onze moduledocumentatie voor informatie over het verkrijgen van de reCAPTCHA-sitesleutel en geheime sleutel';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Om klantberichten direct in de backoffice te kunnen beantwoorden, heeft u uw e-mailadres van uw klant nodig. Zorg er bij het bouwen van een contactformulier voor dat u een e-mailinvoerveld toevoegt en markeer dit als verplicht veld.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'E-mail configuraties';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Om de informatie van uw contactformulier naar de e-mail te sturen die naar de admin- of autoresponder-e-mail is verzonden, kopieert en plakt u de respectieve mailtags in [1]\"Berichttekst\"[/1] veld in [1]\"Contactformulieren > E-mail\"[/1] subtabblad';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Om een bijlage van uw klant via e-mail te ontvangen, navigeert u naar [1]\"Contactformulieren > E-mail\"[/1] en vinkt u het vakje [1]\"Bestandsbijlage\"[/1] aan.';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Als u een bijlagebestand van uw klant wilt ontvangen via het tabblad \'Berichten\', navigeert u naar [1]\"Contactformulieren > Instellingen\"[/1] en schakelt u de optie [1]\"Bijlagen opslaan\"[/1] in.';
